import React from "react";
import { NavLink } from "react-router-dom";
import CommonParent from "./CommonParent";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/Katie-Author-Bio-Pic.png";
const About = (props) => {
  return (
    <section id="header" className="d-flex align-items-center">
      <div className="container-fluid">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row">
              <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                <h1 style="text-align:center">About Me</h1>
                <h1>This page is about me</h1>

                <div className="mt-3">
                  <NavLink smooth to="#contact" className="btn-get-started">
                    Contact Me
                  </NavLink>

                  <NavLink smooth to="#resume" className="btn-get-started">
                    View Resume
                  </NavLink>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
